	// Method to set form fields in the PDF
	public void setField(String fieldName, String value) throws IOException, DocumentException {
		if (value != null) {
			this.form.setField(fieldName, value);
		}
	}

	// Method to generate PDF by filling form fields
	public byte[] genPdf(String sourceTempPDF, String base64) {

		PdfReader pdfTemplate = null;
		PdfStamper stamper = null;

		try {
			// Initialize PdfReader and PdfStamper manually
			FileInputStream input = new FileInputStream(sourceTempPDF);
			pdfTemplate = new PdfReader(input);
			stamper = new PdfStamper(pdfTemplate, this.baos);

			// Get the form fields in the PDF
			this.form = stamper.getAcroFields();
			this.form.setGenerateAppearances(true);
			SimpleDateFormat dateFormat = new SimpleDateFormat("dd-MMM-yyyy");

			// Set hardcoded values in the form fields
			setField("NAME", "viswanth");
			setField("NAME_1", "nithin");
			setField("DOB", "20/03/2002");
			setField("EMAIL", "viswanthkannaiya@gmail.com");
			setField("GENDER", "male");
			setField("PHONE", "9500650190");
			setField("CITY", "namakkal");
			setField("STATE", "namakkal");
			//setImage("APPLICANT_PHOTO", Base64.decode(base64));
			setField("PERIODIC_TICK", "Yes");
			setField("ONE_TICK", "Yes");
			setField("PERPETUAL_TICK", "Yes");
			setField("EMAIL_TICK", "Yes");
			setField("MOBILE_TICK", "Yes");
			setField("PHOTO_TICK", "Yes");
			setField("PROCESSOR_NAME", "sharma");
			setField("EXPIRY_DATE", "10-03-2002");


			// Flatten the form to make fields non-editable
			stamper.setFormFlattening(true);

		} catch (Exception e) {
			e.printStackTrace();
		} finally {
			// Close PdfStamper and PdfReader manually
			try {
				if (stamper != null) {
					stamper.close();
				}
				if (pdfTemplate != null) {
					pdfTemplate.close();
				}
			} catch (IOException | DocumentException e) {
				e.printStackTrace();
			}
		}
		return this.baos.toByteArray();
	}

	private void setImage(String fieldName, byte[] png) throws Exception {
		if (png == null) {
			System.out.println("No PHOTO");
			return;
		}

		PushbuttonField ad = form.getNewPushbuttonFromField(fieldName);
		ad.setLayout(PushbuttonField.LAYOUT_ICON_ONLY);
		ad.setProportionalIcon(true);
		ad.setImage(Image.getInstance(png));
		form.replacePushbuttonField(fieldName, ad.getField());
	}

