	public static String gendratepdf (EntityRequest requestXsd) throws Exception {

		EntityResponce responseXsd = new EntityResponce();
		PropertiesReader prop = new PropertiesReader();

		try {

			System.out.println("Creating PDF - Start");

			InvoiceCalculation invoice = new InvoiceCalculation();
			String baseFolder = prop.getUrlProperty("baseFolder");

			String sourceTempPDF = baseFolder + "datademo.pdf";

			System.out.println("sourceTempPDF-------->>  "+sourceTempPDF);

			String invoicePath = baseFolder + File.separator +"DemoTest_PDF";

			String pdfPath = invoicePath + requestXsd.getPan()+".pdf";

			byte[] pdfBytP1 = invoice.genInvoicePdf(sourceTempPDF, requestXsd.getPan(), requestXsd.getCountOfAcc()
					, requestXsd.getBankCrg());

			File f1 = new File(invoicePath);
			if (!f1.exists()) {
				f1.mkdirs();
			}
			FileOutputStream fos1 = new FileOutputStream(new File(pdfPath));
			fos1.write(pdfBytP1);
			fos1.flush();
			fos1.close();
			System.out.println("Creating PDF - END");
		}catch (Exception e) {
			e.printStackTrace();
			System.err.println("Exception----"+e.getMessage());
		}
		return "SUCCESS";

	}



